import React from 'react';
import Popup from 'reactjs-popup';

function RecordAdd({ exerciseSelection }){
    //console.log(exerciseSelection)

    function handleRecordAddSubmit(e){
        e.preventDefault()
    }

    return(
        <td>
            <Popup trigger=
                {<button>Add Record</button>}
            modal nested>
            {close => (
              <>
              <form className="record-add" onSubmit={(e) => {
                handleRecordAddSubmit(e)
                close()
              }}>
                <legend>Add Record</legend>
                <label>New Data</label>
                <input type="number" placeholder="new data"/><br></br>
                <input type="submit" value="Add" />
              </form>
              </>
            )}
          </Popup>
        </td>
    )

}

export default RecordAdd;
